import { filter } from 'lodash';
import {
  Card,
  Table,
  Stack,
  Avatar,
  Button,
  Checkbox,
  TableRow,
  TableBody,
  TableCell,
  Container,
  Typography,
  TableContainer,
  TablePagination,
  createSvgIcon,
  IconButton,
  Box,
  OutlinedInput,
  InputAdornment
} from '@mui/material';
import { Icon, addIcon } from '@iconify/react';
import AddIcon from '@mui/icons-material/Add';
import searchFill from '@iconify/icons-eva/search-fill';
import { styled } from '@mui/material/styles';
import { Link as RouterLink } from 'react-router-dom';
import * as React from 'react';
import { useState, useEffect } from 'react';
import Page from '../components/Page';

//

const SearchStyle = styled(OutlinedInput)(({ theme }) => ({
  width: 300,
  height: 40,
  backgroundColor: 'white',
  fontSize: 14,
  transition: theme.transitions.create(['box-shadow', 'width'], {
    easing: theme.transitions.easing.easeInOut,
    duration: theme.transitions.duration.shorter
  }),
  // '&.Mui-focused': { width: 320, boxShadow: theme.customShadows.z8 },
  '& fieldset': {
    borderWidth: `1px !important`,
    borderColor: `${theme.palette.grey[500_32]} !important`
  }
}));

export default function Purchase() {
  const [categories, setCategoy] = useState([]);

  const CATEGORYLIST = [
    { name: 'Gift For Her', cost: '1200' },
    { name: 'Birthday Cake', cost: '590' },
    { name: 'Redvelvet Cake', cost: '530' },
    { name: '10 Rose Bouquet', cost: '800' },
    { name: 'Magic Mirror', cost: '1280' },
    { name: 'Customized Cup', cost: '120' },
    { name: 'Personalized Bottle', cost: '300' },
    { name: 'Plant', cost: '200' }
  ];

  return (
    <Page title="PURCHASES - BIZHOPS" backgroundColor="whitesmoke">
      <Container>
        <Box sx={{ padding: 2 }} justifyContent="space-between" display="flex">
          <SearchStyle
            placeholder="Search transaction..."
            startAdornment={
              <InputAdornment position="start">
                <Box component={Icon} icon={searchFill} />
              </InputAdornment>
            }
          />

          <Button variant="contained" color="primary" startIcon={<AddIcon />}>
            Add Transaction
          </Button>
        </Box>
        <TableContainer sx={{ minWidth: 700, paddingLeft: 2 }}>
          <Table sx={{ backgroundColor: 'white' }}>
            <UserListHead
              order={order}
              orderBy={orderBy}
              headLabel={TABLE_HEAD}
              rowCount={CATEGORYLIST.length}
              numSelected={selected.length}
              onRequestSort={handleRequestSort}
              onSelectAllClick={handleSelectAllClick}
            />
            <TableBody>
              {filteredUsers
                .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                .map((row) => {
                  const { id, name, description, featureImage, cost, products } = row;
                  const isItemSelected = selected.indexOf(name) !== -1;

                  return (
                    <TableRow
                      hover
                      key={id}
                      tabIndex={-1}
                      role="checkbox"
                      selected={isItemSelected}
                      aria-checked={isItemSelected}
                    >
                      <TableCell padding="checkbox">
                        <Checkbox
                          checked={isItemSelected}
                          onChange={(event) => handleClick(event, name)}
                        />
                      </TableCell>
                      <TableCell component="th" scope="row" padding="none">
                        <Stack direction="row" alignItems="center" spacing={2}>
                          <Avatar alt={name} src={featureImage} />
                          <Typography variant="subtitle2" noWrap>
                            {name}
                          </Typography>
                        </Stack>
                      </TableCell>
                      <TableCell align="left">Rs. {cost}</TableCell>
                      <TableCell align="left">Rs. {cost + 0}</TableCell>
                      <TableCell align="center">14</TableCell>
                      <TableCell align="center">
                        <IconButton color="secondary" aria-label="upload picture" component="span">
                          <CreateIcon />
                        </IconButton>
                      </TableCell>
                    </TableRow>
                  );
                })}
              {emptyRows > 0 && (
                <TableRow style={{ height: 53 * emptyRows }}>
                  <TableCell colSpan={6} />
                </TableRow>
              )}
            </TableBody>
          </Table>
        </TableContainer>
      </Container>
    </Page>
  );
}
